INSERT INTO `service1` VALUES (1,'2015-08-10 09:28:59','2015-08-19 09:17:34','Beauty','',NULL,'0','',NULL,'/images/ico/mapicon/srv_beauty.png',46,0,1,1,'',NULL),(2,'2015-08-10 09:28:59','2015-08-10 16:29:08','Health Care',NULL,'1','1',NULL,NULL,'/images/ico/mapicon/srv_health_care.png',1,1,0,1,'',NULL),(3,'2015-08-10 09:28:59','2015-08-10 16:29:08','Doctor','','1','158ff822-3af6-4b60-95a9-202c7e73eaae','doctorOrder','  <img  src=\"nbdimages/images/img-1.jpg\" alt=\"doctor image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">We guarantee Best Doctors and Specialists at your location</h3><p class = \"textContentId1\"> No more waiting for long hours in Clinics  </p><p class = \"textContentId2\">   No more wasting time in Traffic </p>                 <p class = \"textContentId3\">  No more ignoring of your health for time, company confusion. </p>','/images/ico/mapicon/srv_doctor.png',10,0,0,1,'',NULL),(4,'2015-08-10 09:28:59','2015-08-10 16:29:08','Electrician','','2','1b867019-e781-4726-930d-e3a44dbb6fac','pathologyOrder','  <img  src=\"nbdimages/images/electrician-1.jpg\" alt=\"electrician image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Is Electricity issue? Non functioning gadgets? Do not worry about it. We are here to fix these issues.</h3><p class = \"textContentId1\"> 100% Safety Guaranteed, Free Service if the problem recurs  </p><p class = \"textContentId2\">   Qualified & Trained Engineers </p>                 <p class = \"textContentId3\">  Trained staff in repairing household electrical points, fans, lights, wiring problem, short circuit issues etc. </p> <p class = \"textContentId4\">  Specialized engineers in branded & local large appliances like Geysers, Air Conditioners, Television, Refrigerators, Washing Machines </p>','/images/ico/mapicon/srv_electrician.png',16,0,0,1,'',NULL),(5,'2015-08-10 09:28:59','2015-08-10 16:29:08','Up Keeping',NULL,'2','2',NULL,NULL,'/images/ico/mapicon/srv_up_keeping.png',1